// src/components/LogoutButton.js
import React from 'react';

const LogoutButton = ({ setToken }) => {
  const handleLogout = () => {
    setToken(null);
    // Clear token from localStorage or session storage
  };

  return (
    <button onClick={handleLogout}>Logout</button>
  );
};

export default LogoutButton;
